import './EquipmentNav.css'

function EquipmentNav() {
    return (
            <ul className="equipmentNav">
                <li className="equipmentNav__item">Все товары</li>
                <li className="equipmentNav__item">1С</li>
                <li className="equipmentNav__item">Смарт-терминал</li>
                <li className="equipmentNav__item">Фискальный регистратор</li>
                <li className="equipmentNav__item">Сканеры-штрихкодов</li>
                <li className="equipmentNav__item">Принтер этикеток</li>
            </ul>
    );
  }

  export default EquipmentNav;
